import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import styles from './Navbar.module.css';

export class Navbar extends Component {
    saveCat = (name, image) => {
        fetch('/create', {
            method: 'POST',
            body: JSON.stringify({
                name: name,
                image: image
            }),
            headers: {"Content-Type": "application/json"}
        });
    }
    render() {
        return (
            <nav className={styles.Navbar}>
                <div className={styles.homeBtn}>
                    <Link to={'./'}>
                        <button variant="raised">
                            home
                        </button>
                    </Link>
                </div>
                <Link to={'./list'}>
                    <button variant="raised">
                        My List
                    </button>
                </Link>
                <Link to={'./saveCat'}>
                    <button variant="raised">
                        saveCat
                    </button>
                </Link>
                <Link to={'./users'}>
                    <button variant="raised">
                        My User
                    </button>
                </Link>
                <Link to={'./Contact'}>
                    <button variant="raised">
                        Contact Me
                    </button>
                </Link>
                <button onClick={() => this.saveCat("Bass Creek", "https://placeimg.com/640/480/nature")} variant="raised">
                    Create
                </button>
            </nav>
        )
    }
}

export default Navbar
